/**
 * Definition for singly-linked list.
 * struct ListNode {
 *     int val;
 *     ListNode *next;
 *     ListNode() : val(0), next(nullptr) {}
 *     ListNode(int x) : val(x), next(nullptr) {}
 *     ListNode(int x, ListNode *next) : val(x), next(next) {}
 * };
 */
class Solution {
public:
    
    bool has_ge_nodes(ListNode* head,int k){
        int size=0;
        
        while(head!=nullptr){
            size++;
            head=head->next;
            if(size>=k)
                return true;
        }
        return false;
    }
    
    ListNode* next_part(ListNode* head,int k){
        for(int i=0;i<k;i++){
            head=head->next;
        }
        return head;
    }
    
    // this function should return the head of reversed list
    ListNode* k_reverse(ListNode* head,int k){
    
        bool has_at_least_k_more_nodes=has_ge_nodes(head,k);
        if(!has_at_least_k_more_nodes)
            return head;
            
        ListNode* head_of_next_part=k_reverse(next_part(head,k),k);
        
        ListNode* curr_node=head;
        ListNode* prev_node=head_of_next_part;
        ListNode* next_node;
        for(int i=0;i<k;i++){
            next_node=curr_node->next;
            curr_node->next=prev_node;
            prev_node=curr_node;
            curr_node=next_node;
        }
        return prev_node;
    }
    
    ListNode* reverseKGroup(ListNode* head, int k) {
        return k_reverse(head,k);
    }
};

