  initial begin
    $display("Time\ti\t\to");
    $monitor("%0t\t%b(%2d)\t%b(%0d)", $time, i, i, o, o);
    i = 0;
    for (k = 1; k < 16; k = k + 1)
      #10 i = k;
  end
endmodule

def resetPassword(s):
    counter = {}
    
    for c in s:
        counter[c] = 1 + counter.get(c, 0)
    
    print(counter)
    uneven = []
    for k, v in counter.items():
        if v % 2 == 1:
            uneven.append(k)
            
    uneven.sort()
    
    for i in range(len(uneven)//2):
        uneven[len(uneven)-1-i] = uneven[i]
    
    for k, v in counter.items():
        if v % 2 == 0:
            uneven += [k] * v
            
    uneven.sort()
    
    # i = 0
    cg = {}
    for c in uneven:
        cg[c] = 1 + cg.get(c, 0)
    
    midC = ''
    res = []
    for k, v in cg.items():
        if v % 2 == 1:
            midC = k
        
        res += k * (v//2)
        
    print(res)
        
    return ''.join(res) + midC + ''.join(res[::-1])

# Example usage
n = 4
s = 'aebcd'
result = resetPassword(s)
print(result)  # Output: 'abbca'

