import java.util.Scanner;

public class ECommerceOrderProcessing {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        int orderState = 0;
        boolean orderComplete = false;

        while (!orderComplete) {
            System.out.println("E-Commerce Order Processing System:");
            System.out.println("1. New Order");
            System.out.println("2. Order Processing");
            System.out.println("3. Shipped");
            System.out.println("4. Delivered");
            System.out.println("5. Cancel Order");
            System.out.println("6. Exit");
            System.out.print("Enter your choice: ");
            int action = scanner.nextInt();

            switch (orderState) {
                case 0: // New Order
                    switch (action) {
                        case 1:
                            System.out.println("Order placed. Awaiting processing.");
                            orderState = 1;
                            break;
                        case 6:
                            orderComplete = true;
                            break;
                        default:
                            System.out.println("Invalid action for the current order state.");
                            break;
                    }
                    break;

                case 1: // Order Processing
                    switch (action) {
                        case 2:
                            System.out.println("Order is being processed.");
                            orderState = 2;
                            break;
                        case 5:
                            System.out.println("Order canceled.");
                            orderState = 0;
                            break;
                        case 6:
                            orderComplete = true;
                            break;
                        default:
                            System.out.println("Invalid action for the current order state.");
                            break;
                    }
                    break;

                case 2: // Shipped
                    switch (action) {
                        case 3:
                            System.out.println("Order has been shipped.");
                            orderState = 3;
                            break;
                        case 5:
                            System.out.println("Order canceled.");
                            orderState = 0;
                            break;
                        case 6:
                            orderComplete = true;
                            break;
                        default:
                            System.out.println("Invalid action for the current order state.");
                            break;
                    }
                    break;

                case 3: // Delivered
                    switch (action) {
                        case 4:
                            System.out.println("Order has been delivered. Thank you for your purchase!");
                            orderState = 0;
                            break;
                        case 5:
                            System.out.println("Order canceled.");
                            orderState = 0;
                            break;
                        case 6:
                            orderComplete = true;
                            break;
                        default:
                            System.out.println("Invalid action for the current order state.");
                            break;
                    }
                    break;

                default:
                    System.out.println("Invalid order state.");
                    break;
            }
        }

        System.out.println("Exiting the order processing system.");
        scanner.close();
    }
}

