/**
 * This is a collector for indexing a stream of objects where each object may end up appoaring at multiple places in the table. This assumes
 * the that locations in the table are the cross-product of the row and column values.
 *
 * @param <R> The type of the rows.
 * @param <C> The type of the columns.
 * @param <T> The type of the object to index.
 */
public static class TableMultiEntryCollector<R,C,T> implements java.util.stream.Collector<T,com.google.common.collect.HashBasedTable<R,C,T>,com.google.common.collect.Table<R,C,T>>{
    /**
     * For a given object, return all the rows it will appear under.
     */
    private final java.util.function.Function<T,? extends Collection<R>> rowsExtractor;

    /**
     * For a given object, return all the columns it will appear under.
     */
    private final java.util.function.Function<T,? extends Collection<C>> columnsExtractor;

    public TableMultiEntryCollector(
            final Function<T, ? extends Collection<R>> rowsExtractor, 
            final Function<T, ? extends Collection<C>> columnsExtractor
    ) {
        this.rowsExtractor = rowsExtractor;
        this.columnsExtractor = columnsExtractor;
    }

    /**
     * Factory method.
     */
    public static <R,C,T> TableMultiEntryCollector<R,C,T> indexingBy(
            final java.util.function.Function<T,? extends Collection<R>> rowsExtractor,
            final java.util.function.Function<T,? extends Collection<C>> columnsExtractor
    ){
        return new TableMultiEntryCollector<>( rowsExtractor, columnsExtractor );
    }

    @Override
    public Supplier<HashBasedTable<R, C, T>> supplier() {
        return HashBasedTable::create;
    }

    @Override
    public java.util.function.BiConsumer<HashBasedTable<R, C, T>, T> accumulator() {
        return (table,type)-> {
            final Collection<R> rows = rowsExtractor.apply(type);
            final Collection<C> columns = columnsExtractor.apply(type);

            rows.forEach( row ->
                columns.forEach( column ->
                        table.put(row,column,type)
                )
            );
        };
    }

    @Override
    public java.util.function.BinaryOperator<HashBasedTable<R, C, T>> combiner() {
        return (tableResult,tableAddition) -> {
            //merge the tables
            tableResult.putAll(tableAddition);
            return tableResult;
        };
    }

    @Override
    public java.util.function.Function<HashBasedTable<R, C, T>, Table<R, C, T>> finisher() {
        // cannot use Function.identity() here because we are implicitly upcasting here to the parent class
        return t->t;
    }

    @Override
    public java.util.Set<Characteristics> characteristics() {
        return Collections.singleton(Characteristics.IDENTITY_FINISH);
    }


}

