    class BitBuffer
    {
        private const int BufferSize = 8;
        private byte[] buffer = new byte[1];
        private byte currBuf = new byte();
        private int bufferCount = 0;
        BinaryWriter writer = null;

        public BitBuffer(BinaryWriter writer)
        {
            this.writer = writer;
        }
        public void PushBit(bool bit)
        {
           
            currBuf <<= 1;
            if (bit)
            {
                currBuf |= 1;
            }

            bufferCount++;

            if (bufferCount >= BufferSize)
            {
                FlushBuffer();
            }
        }

        public void Convert(string bits)
        {
            foreach (char bit in bits)
            {
                PushBit(bit == '1');
            }
        }

        public void FlushBuffer()
        {
            for (int i = 7; i >= 0; i--)
            {
                bool bit = (currBuf & (1 << i)) == 0;
                Console.Write(bit ? '0' : '1');
            }
            Console.WriteLine();
            //Console.WriteLine(currBuf);
            buffer[0] = currBuf;
            writer.Write(currBuf);
            currBuf = 0;
            bufferCount = 0;
        }

        public bool IsEmpty => bufferCount == 0;

        public int Size => bufferCount;
    }
    public class HuffmanNode
    {
        public double Key { get; set; }
        public char Symbol { get; set; }
        public HuffmanNode Left { get; set; }
        public HuffmanNode Right { get; set; }
        public bool IsTerminal { get; set; }
    }
    public class PriorityQueue/*<T> where T : IComparable<T>*/
    {
        private List<HuffmanNode> heap;

        public PriorityQueue()
        {
            heap = new List<HuffmanNode>();
        }

        public PriorityQueue(IEnumerable<HuffmanNode> collection)
        {
            heap = new List<HuffmanNode>(collection);
            BuildHeap();
        }

        public void Enqueue(HuffmanNode item)
        {
            heap.Add(item);
            HeapifyUp(heap.Count - 1);
        }

        public HuffmanNode Dequeue()
        {
            if (IsEmpty())
            {
                throw new InvalidOperationException("Priority queue is empty.");
            }

            HuffmanNode minItem = heap[0];
            int lastIndex = heap.Count - 1;
            heap[0] = heap[lastIndex];
            heap.RemoveAt(lastIndex);
            HeapifyDown(0);

            return minItem;
        }

        public HuffmanNode Peek()
        {
            if (IsEmpty())
            {
                throw new InvalidOperationException("Priority queue is empty.");
            }

            return heap[0];
        }

        public bool IsEmpty()
        {
            return heap.Count == 0;
        }

        private void HeapifyUp(int index)
        {
            int parentIndex = (index - 1) / 2;
            while (index > 0 && heap[index].Key.CompareTo(heap[parentIndex].Key) < 0)
            {
                Swap(index, parentIndex);
                index = parentIndex;
                parentIndex = (index - 1) / 2;
            }
        }

        private void HeapifyDown(int index)
        {
            int leftChildIndex = 2 * index + 1;
            int rightChildIndex = 2 * index + 2;
            int smallestIndex = index;

            if (leftChildIndex < heap.Count && heap[leftChildIndex].Key.CompareTo(heap[smallestIndex].Key) < 0)
            {
                smallestIndex = leftChildIndex;
            }

            if (rightChildIndex < heap.Count && heap[rightChildIndex].Key.CompareTo(heap[smallestIndex].Key) < 0)
            {
                smallestIndex = rightChildIndex;
            }

            if (smallestIndex != index)
            {
                Swap(index, smallestIndex);
                HeapifyDown(smallestIndex);
            }
        }

        private void Swap(int i, int j)
        {
            HuffmanNode temp = heap[i];
            heap[i] = heap[j];
            heap[j] = temp;
        }

        private void BuildHeap()
        {
            int lastNonLeafIndex = (heap.Count - 2) / 2;
            for (int i = lastNonLeafIndex; i >= 0; i--)
            {
                HeapifyDown(i);
            }
        }
        public void PrintHeapTree()
        {
            PrintHeapTreeRecursive(0, 0);
        }
        private void PrintHeapTreeRecursive(int index, int level)
        {
            if (index < heap.Count)
            {
                PrintHeapTreeRecursive(2 * index + 2, level + 1);


                for (int i = 0; i < level; i++)
                {
                    Console.Write("    ");
                }


                Console.WriteLine(heap[index].Symbol);

                PrintHeapTreeRecursive(2 * index + 1, level + 1);
            }
        }

    }
