    ret =0;
    for(int i =0 ; i <= 9 ; i++){
        if(i==4) continue;
        if(i > S[idx]-'0' and !sm) break;
        ret += rec(idx+1 , sm or  i < S[idx]-'0');
    }
    
    return ret ;
}


